            -webkit-background-clip: text; 
            -webkit-text-fill-color: transparent; 
            display: initial; 
        }
    }

    .calendar__main{
        .calendar__days-name{
            font-family: Montserrat;
            display: flex;
            flex-direction: row;
            justify-content: space-around;

            * { 
                height: 40px;
                line-height: 40px;
                font-style: normal;
                font-weight: bold;
                font-size: 12px;    
                color: #BC9CFF;
            }
        }
        .calendar__days{
            display: flex;
            flex-direction: row;
            flex-wrap: wrap;
        
            .day{
                cursor: pointer;
                -webkit-user-select: none;
                text-align: center;
                //line-height: 40px;
                font-style: normal;
                font-weight: normal;
                font-size: 12px;
                width: 14.2%;     
            }

            //Стили нажатий на календарь
            .pushed-up{
                background: linear-gradient(180deg, #6FCF97 0%, #66D2EA 100%);
                border-radius: 22px;
                color: #FFFFFF !important;
            }

            .pushed-down{
                background: linear-gradient(180deg, rgba(111, 207, 151, 0.445) 0%, rgba(102, 210, 234, 0.466) 100%);
                border-radius: 22px;
                color: #FFFFFF !important;
            }

            .mouse-on{
                background: rgba(145, 145, 145, 0.11);
                border-radius: 22px;
            }

            .other-month-day{
                color: rgba(31, 32, 65, 0.25);
            }

            .curr-month-day{
                color: rgba(31, 32, 65, 0.5);
            }

